import Link from 'next/link';

function Menu(){

    return (
    <p>
    Menu:
    <ul>
    <li><Link href="/profile"><a>Profile</a></Link></li>
    <ul>
    <li><Link href="/proyek/Galeriproduk"><a>Galeri Produk</a></Link></li>
    <li><Link href="/proyek/pemesanan"><a>Pemesanan</a></Link></li>
    </ul>
    </ul>
    </p>
    );
   }

   export default Menu;
